Just copy webxdc.d.ts into your source dir: type SendingStatusUpdate<T> = { /** the payload, deserialized json: * any javascript primitive, array or object. */ payload: T; /** optional, short, informational message that will be added to the chat, * eg. "Alice voted" or "Bob scored 123 in MyGame"; * usually only one line of text is shown, * use this option sparingly to not spam the chat. */ info?: string; /** optional, if the Webxdc creates a document, you can set this to the name of the document; * do not set if the Webxdc does not create a document */ document?: string; /** optional, short text, shown beside the icon; * it is recommended to use some aggregated value, * eg. "8 votes", "Highscore: 123" */ summary?: string;
}; type ReceivedStatusUpdate<T> = { /** the payload, deserialized json */ payload: T; /** the serial number of this update. Serials are larger than 0 and newer serials have higher numbers */ serial: number; /** the maximum serial currently known */ max_serial: number; /** optional, short, informational message. */ info?: string; /** optional, if the Webxdc creates a document, this is the name of the document; * not set if the Webxdc does not create a document */ document?: string; /** optional, short text, shown beside the webxdc's icon. */ summary?: string;
}; interface Webxdc<T> { /** Returns the peer's own address. * This is esp. useful if you want to differ between different peers - just send the address along with the payload, * and, if needed, compare the payload addresses against selfAddr() later on. */ selfAddr: string; /** Returns the peer's own name. This is name chosen by the user in their settings, if there is nothing set, that defaults to the peer's address. */ selfName: string; /** * set a listener for new status updates. * The "serial" specifies the last serial that you know about (defaults to 0). * Note that own status updates, that you send with {@link sendUpdate}, also trigger this method * @returns promise that resolves when the listener has processed all the update messages known at the time when `setUpdateListener` was called. * */ setUpdateListener(cb: (statusUpdate: ReceivedStatusUpdate<T>) => void, serial?: number): Promise<void>; /** * WARNING! This function is deprecated, see setUpdateListener(). */ getAllUpdates(): Promise<ReceivedStatusUpdate<T>[]>; /** * Webxdc are usually shared in a chat and run independently on each peer. To get a shared status, the peers use sendUpdate() to send updates to each other. * @param update status update to send * @param description short, human-readable description what this update is about. this is shown eg. as a fallback text in an email program. */ sendUpdate(update: SendingStatusUpdate<T>, description: string): void;
} ////////// ANCHOR: global
declare global { interface Window { webxdc: Webxdc<any>; }
}
////////// ANCHOR_END: global export { SendingStatusUpdate, ReceivedStatusUpdate, Webxdc }; you can find it also on https://github.com/deltachat/webxdc_docs/blob/master/webxdc.d.ts or just copy the code block above. In the future this might become an @types npm module, but for now it is what it is: a simple file copy with no automatic updates .

